import{_ as e,o as a,c as r,O as t}from"./chunks/framework.9482e208.js";const p=JSON.parse('{"title":"§ 22.1-289.056 (Effective July 1, 2021) Storage of firearms in certain family day homes.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/22.1-289.056.md","filePath":"vacode/22.1-289.056.md"}'),o={name:"vacode/22.1-289.056.md"},i=t('<h1 id="§-22-1-289-056-effective-july-1-2021-storage-of-firearms-in-certain-family-day-homes" tabindex="-1">§ 22.1-289.056 (Effective July 1, 2021) Storage of firearms in certain family day homes. <a class="header-anchor" href="#§-22-1-289-056-effective-july-1-2021-storage-of-firearms-in-certain-family-day-homes" aria-label="Permalink to &quot;§ 22.1-289.056 (Effective July 1, 2021) Storage of firearms in certain family day homes.&quot;">​</a></h1><p>During hours of operation, all firearms in a family day home licensed pursuant to § <a href="/vacode/22.1-289.011/">22.1-289.011</a> or voluntarily registered pursuant to § <a href="/vacode/22.1-289.011/">22.1-289.011</a> or in a family day home approved by a family day system shall be stored unloaded in a locked container, compartment, or cabinet, and all ammunition shall be stored in a separate locked container, compartment, or cabinet. The key or combination to such locked containers, compartments, or cabinets shall be inaccessible to all children in the home.</p><p>2020, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP0910" target="_blank" rel="noreferrer">910</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP0911" target="_blank" rel="noreferrer">911</a>, § 63.2-1701.01.</p>',3),n=[i];function c(l,s,f,m,d,h){return a(),r("div",null,n)}const y=e(o,[["render",c]]);export{p as __pageData,y as default};
